import React from "react";
import axios from "axios";
import SearchBar from "./SearchBar"


class App extends React.Component {

    onSerchSubmit(term) {
       axios.get('https://api.unsplash.com/search/photos',{
        params:{ query: term },
        headers: {
            Authorization: 'Client-ID eLwxP-wWnUO2IU2fnLMuQIILKYeEjXtkIvPVgEtdi_A'
        }
       })
    }
    render() {
        return (
            <div className="ui container" style={{ marginTop: '10px' }}><SearchBar onSearch={this.onSerchSubmit} /></div>
        );
    }
};

export default App;
